INSERT INTO `same_getlog` (`id`, `content`, `openid`, `msgtype`, `event`, `eventkey`, `createtim`, `timeint`) VALUES
(403, '<xml><ToUserName><![CDATA[gh_49e218dd4cee]]></ToUserName>\n<FromUserName><![CDATA[ovv-6jthBtkvHg8GZ5klkL4DTKkw]]></FromUserName>\n<CreateTime>1426592479</CreateTime>\n<MsgType><![CDATA[text]]></MsgType>\n<Content><![CDATA[21世纪是一个空间影响力时代，21世纪是一个超能量的时代，空间影响力×光速的N次方就是超能量。提纯知识的知识是智慧；提纯智慧的智慧是能量；提纯能量的能量是超能量；穿越时空，你想飞翔你就来……一源超能量课程集——《钱道》、《寻找穿越时空的爱》、《超能量演说道》、《终极飞翔之72变》、《商人终极修行的六大境界》、《修行的四大法门》、《大成思维，秒成时代》、《超级混凝土战略》、《商业帝国》、《人性之光》、《变现的六大法门》、《帝王的六项修炼》、《财富乾坤大挪移》……  价值千万……这是一个度化的场，这是一个修身养性的场，这是一个能量修复的场⋯⋯生死相约，不见不散，时间：3月18日一3月21日，10：30一17：30分，地址：上海漕宝路70号光大会展c座2306室，一源老师给你开启财富的天堂……!!!\n结缘电话18283908805，交付课免费，来电报名预留席位。]]></Content>\n<MsgId>6127168042227683013</MsgId>\n</xml>', 'ovv-6jthBtkvHg8GZ5klkL4DTKkw', 'text', NULL, NULL, '2015-03-17 11:41:19', 1426592479),
