(18, 13, 'click', 'news', '', 0, '', 'Chloé 店铺查询', '点击“+”按钮，推送您的地址信息，即可获得您附近的 Chloé 专卖店位置。', '/upload/img/20150706/142245-269.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=210067330&idx=1&sn=a85996e46795973ebc59fd32e400d0c6#rd', '2015-06-29 03:51:18'),
(19, 0, 'text', 'text', '你好', 0, '你好啊', '', '', '', '', '2015-06-29 04:00:37'),
(20, 0, 'text', 'news', 'alphabet', 0, '', 'Chloé Alphabet', '《The Alphabet》展览的灵感来自Chloé创始人Gaby Aghion，和她独特的以字母为系列及服装取名的做法。', '/upload/img/20150703/163758-789.png', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202130253&idx=1&sn=78269f81cd02edca054fd0ef24bb93f8#rd', '2015-07-03 08:38:12'),
(21, 0, 'text', 'news', 'a', 0, '', 'A / ATTITUDES', '《Chloé‧Attitudes》是Chloé举办的第一个展览会，以肯定品牌在过去60年对时装文化的贡献。', '/upload/img/20150703/164017-254.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202130379&idx=1&sn=91d72ed7c4dfcbe0dd2e296197a92ae9#rd', '2015-07-03 08:40:25'),
(22, 0, 'text', 'news', 'b', 0, '', 'B / BANANAS（香蕉）', '史黛拉‧麦卡尼（Stella McCartney）于2001年以香蕉为题材，从流行艺术取得灵感，在T恤和泳衣前面使用香蕉贴花，衣服背面有“您的香蕉别靠近我的蜜瓜”的字样。', '/upload/img/20150703/164102-108.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202130431&idx=1&sn=2a3d90c4efa50c48303f517fbeb4aaed#rd', '2015-07-03 08:41:05'),
(23, 0, 'text', 'news', 'c', 0, '', 'C / COUNTER-COUTURE（反高级订制）', 'Gaby Aghion于1945年来到巴黎，她准备打破母亲那一代所遭受的束缚，不但要改变生活方式，还包括她们身上所穿的死板的服装。', '/upload/img/20150703/164147-899.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202130609&idx=1&sn=b64eecb5da2d79cf102bf9e6ef8fde74#rd', '2015-07-03 08:41:50'),
(24, 0, 'text', 'news', 'd', 0, '', 'D / DECO（装饰）', '装饰对Chloé有什么重要性？偏好图像的对称和几何形状，捨弃过分讲究的风格，这是各个Chloé系列散发的一种感觉。', '/upload/img/20150703/164217-303.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202130648&idx=1&sn=20f172811b196e00b0c1583642eeab60#rd', '2015-07-03 08:42:26'),
(25, 0, 'text', 'news', 'e', 0, '', 'E / EMBROIDERY（刺绣）', 'Chloé创办人Gaby Aghion虽然摒弃高级订制服的拘束设计，却热爱各种手工艺。 但Gaby不是沿用传统的旧式刺绣，而是为这项古老的手工艺注入年轻和玩味的设计，也许是用缝线说故事，或者在朴素的衬衫上加些金线增添奢华感。', '/upload/img/20150703/164339-984.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202130678&idx=1&sn=852b1dbad278631258ce3806904a9b3a#rd', '2015-07-03 08:43:41'),
(26, 0, 'text', 'news', 'f', 0, '', 'F / FLUIDITY（流动感）', 'Gaby Aghion早期为年轻自主的女性创作服装，这种与高级订制服装的正式外形构成强烈对比的崭新意念演变成Chloé的美学概念，一直沿用至今。', '/upload/img/20150703/164412-927.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202130714&idx=1&sn=d604592c443f2d62941539e1a1c38530#rd', '2015-07-03 08:44:52'),
(27, 0, 'text', 'news', 'g', 0, '', 'G / GABY', 'Gaby Aghion在1921年生于埃及。作为富裕知识分子阶层的一员，她接受法式教育，因而学习到巴黎人的高雅。18岁时，Gaby留学巴黎。其间她看到不同事物，启发她的设计创意，埋下了成立Chloé的伏笔。', '/upload/img/20150703/164528-421.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202130723&idx=1&sn=808f52c5b1d86006e52f603447a13cb7#rd', '2015-07-03 08:45:40'),
(28, 0, 'text', 'news', 'h', 0, '', 'H / HORSES（马匹）', '对Chloé女性来说，马匹和她心灵相通──奔放而热爱自由。而自由是Chloé的基本特质。\n', '/upload/img/20150703/164621-455.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202130743&idx=1&sn=49e68b5725410302d82ccd74580161a8#rd', '2015-07-03 08:46:23'),
(29, 0, 'text', 'news', 'i', 0, '', 'I / INNOVATORS（创新者）', '从1952年创立开始，Chloé一直推出创新概念。最先在Gaby Aghion的带领下，品牌首创奢华成衣服装的运动，并建立了吸引年轻一代的时装公司。', '/upload/img/20150703/164656-120.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202130781&idx=1&sn=e921b9268aec2ca7ba9d36c687dbd14e#rd', '2015-07-03 08:47:07'),
(30, 0, 'text', 'news', 'j', 0, '', 'J / JOY（喜乐）', '70年代末及80年代初，Chloé的时装表演会安排模特儿——包括别具风格的时尚界典范人物Pat Cleveland——在表演中尽情享受，和观众以眼神交流。', '/upload/img/20150703/164755-398.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202130794&idx=1&sn=a9a1625982c0b5d7c5c9150ce43bf05f#rd', '2015-07-03 08:47:57'),
(31, 0, 'text', 'news', 'k', 0, '', 'K / KALEIDOSCOPE（万花筒）', '裸色，这种哑光米色来自品牌创办人Gaby Aghion及她的埃及背景：沙粒及金字塔之色；日晒肌肤之色。这种女性特质及天然女性美的象征，存在于Chloé的核心。', '/upload/img/20150703/164832-215.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202130819&idx=1&sn=f1ae5551a5f724fc7a9992fc8759b6e8#rd', '2015-07-03 08:48:38'),
(32, 0, 'text', 'news', 'l', 0, '', 'L / LIGHT（光）', 'Chloé女性在自然光的拥抱中感觉自由──快乐、微笑、年轻，均从Chloé系列的浅棕色调及Chloé时装的轻巧质感反映出来。', '/upload/img/20150703/164911-481.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202130844&idx=1&sn=3e91d171d205eb540a9fed217d877188#rd', '2015-07-03 08:49:13'),
(33, 0, 'text', 'news', 'm', 0, '', 'M / MUSIC（音乐）', '乐器及音符从Chloé创立之初即成为服装上的印花及刺绣，品牌创办人及音乐爱好者Gaby Aghion亦以她一些最喜爱的作曲家和音乐家，包括Debussy及Dylan等命名其设计。', '/upload/img/20150703/164936-730.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202130896&idx=1&sn=b4521288c7477a795ff63e0d005e98de#rd', '2015-07-03 08:49:44'),
(34, 0, 'text', 'news', 'n', 0, '', 'N / NUDE（裸色）', '对Chloé来说，服装的主要角色是装饰和美化裸体，而不是隐藏其天然美。\n', '/upload/img/20150703/165013-484.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202130921&idx=1&sn=9a14838ec8f53735226e0ac510f2d5ba#rd', '2015-07-03 08:50:15'),
(35, 0, 'text', 'news', 'o', 0, '', 'O', '圆形是Chloé常见的美学主题。圆润诱惑的形状出现于印花、刺绣及轮廓上。最具代表性的Chloé手袋Paddington及Marcie形状柔和圆满，坚硬配件并与之配合。你意识到O的存在时，就会在Chloé各处看到这个字母。', '/upload/img/20150703/165046-631.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202130956&idx=1&sn=7a2d291d13d454f67932a63ef2b23807#rd', '2015-07-03 08:50:58'),
(36, 0, 'text', 'news', 'p', 0, '', 'P / PARIS（巴黎）', '巴黎一直是Chloé历史中的焦点。Gaby初到巴黎时，那里是波希米亚风格知性文化以及左岸年轻反传统分子的圣地。Chloé能准确捕捉巴黎当下的气氛，即设计年轻化，展现反叛不羁的精神。', '/upload/img/20150703/165433-584.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202130987&idx=1&sn=7980f3c87b449a6ba0196955bf7deb7c#rd', '2015-07-03 08:54:34'),
(37, 0, 'text', 'news', 'q', 0, '', 'Q / QUOTES（引言）', '现在我们谨以Chloé 创办人Gaby Aghion之词庆祝品牌面世60年。这些难忘的引言具独特见解，反映出她的个性，以及品牌长存的价值及精髓。', '/upload/img/20150703/165502-712.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202131009&idx=1&sn=74d47ef2a4db2746b8520cccf27d5619#rd', '2015-07-03 08:55:04'),
(38, 0, 'text', 'news', 'r', 0, '', 'R / RACHMANINOFF（拉赫曼尼诺夫）', '作为爱好艺术的知识分子，Gaby Aghion定下一个为其系列及每件作品取名的独有传统。', '/upload/img/20150703/165543-675.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202131235&idx=1&sn=69e36932f22b277fad4740a2a9d82264#rd', '2015-07-03 08:55:45'),
(39, 0, 'text', 'news', 's', 0, '', 'S / SKIN（皮肤）', '对Chloé来说，事物的外貌和所营造的感觉一样重要，因此说到配饰时，我们使用最优质的皮革，它们平滑天然，就像常伴身旁的密友，触感总是柔软。', '/upload/img/20150703/165604-312.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202131258&idx=1&sn=885a6d654e4c5ed276fcb3a593112009#rd', '2015-07-03 08:56:13'),
(40, 0, 'text', 'news', 't', 0, '', 'T / TROMPE L’OEIL（错视画法）', '错视画法存在于超现实主义美学概念的核心中。这种“瞒骗双眼”的画法是一种视觉错觉，即一个平面图像描画出一些乍看起来立体的对象。比如墙上画着的一扇门，或意式壁画天花的圆顶。', '/upload/img/20150703/165638-883.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202131273&idx=1&sn=45609a1a30f0ea290493434e26367ed1#rd', '2015-07-03 08:56:49'),
(41, 0, 'text', 'news', 'u', 0, '', 'U / YOU', 'Chloé女孩低调淡雅；格调自信，外表沉静。因此Chloé偶尔喜欢让聚光灯照亮别人。这个主题以您，“U”，为主。', '/upload/img/20150703/165721-628.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202131292&idx=1&sn=00f7bc9d83c2b3d156687f0d2be683cd#rd', '2015-07-03 08:57:23'),
(42, 0, 'text', 'news', 'v', 0, '', 'V / VISIT（参观）', '《Chloé‧Attitudes》是为肯定Chloé对时装文化作出60年贡献所办的展览。', '/upload/img/20150703/165801-241.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202131309&idx=1&sn=665b0160aa0296e61df20c4a7681995c#rd', '2015-07-03 08:58:02'),
(43, 0, 'text', 'news', 'w', 0, '', 'W / WOMAN（女性）', 'Chloé女性并不是特定的某一个人， 她妩媚柔美，但抗拒时装的矫揉造作。', '/upload/img/20150703/165826-942.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202131318&idx=1&sn=e9fc2d7e6f0f17e80846c87f0d4570c6#rd', '2015-07-03 08:58:27'),
(44, 0, 'text', 'news', 'x', 0, '', 'X / KISS', '要向圆满结束的《Chloé‧Attitudes》展览道别时，有什么比一首特别为Chloé而创作的乐曲更合适呢？', '/upload/img/20150703/165910-377.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202131329&idx=1&sn=204ebacab9dd3d18228783e444480897#rd', '2015-07-03 08:59:12'),
(45, 0, 'text', 'news', 'y', 0, '', 'Y / YOUTHFUL（年轻）', 'Chloé总是着力表现年轻、清新的特质。创办人Gaby Aghion希望吸引更年轻、具创意、自由奔放的女性，她们每天在她身边出现，为她带来灵感。', '/upload/img/20150703/165933-700.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202131346&idx=1&sn=8c31a2bba9195b4b026ace7e5df7147e#rd', '2015-07-03 08:59:39'),
(46, 0, 'text', 'news', 'z', 0, '', 'Z / ZOOM（拉近）', '任何对Chloé的设计美学的探索都不能忽略品牌一些极致精细奢华的作品，它们所蕴藏的细节和工艺值得深入研究。', '/upload/img/20150703/170010-334.jpg', 'http://mp.weixin.qq.com/s?__biz=MzA4NjAwNTI3Ng==&mid=202131366&idx=1&sn=45b9f7c16759c5b0c7320a20c05eb79d#rd', '2015-07-03 09:00:11'),
